import React, { Component } from 'react'
import {
  Card,
  CardContent,
  Typography,
  CardMedia
} from '@material-ui/core'
import { connect } from 'react-redux'
import compose from 'recompose/compose'
import image from '../assets/compositor\ 1.png'

class CarCard extends Component {


  componentWillReceiveProps(nextProps) {

  }

  renderPicture = () => {
    return require('./modelX.png')
}


  render() {
    const { title, modelName } = this.props
    // const image =  URL.createObjectURL('../assets/Vector.png');
    return (
          <Card className="eachCarCard">
            {/* <CardMedia wide image='https://images.pexels.com/photos/67636/rose-blue-flower-rose-blooms-67636.jpeg' /> */}
      <CardMedia
      image={this.renderPicture().toString()}
      style={{ width: "100%", height: "150px" }}
        // className="eachCarImage"
        title={title}
      />
      <CardContent>
        <Typography variant="body2" color="textSecondary" component="p">
          {title}
        </Typography>
      </CardContent>
    </Card>
    )
  }
}

/**
 * Function to call the action to call API to send login credentials for verification
 */
function mapDispatchToProps(dispatch) {
  return {
  }
}
/**
 * Function to receive the state of login api call response
 */
function mapStateToProps(state) {
  return {
  }
}

export default compose(
  connect(
    mapStateToProps,
    mapDispatchToProps
  )
)(CarCard)
